def paint_letterboxes(start, finish):
    xs = [0] * 10
    for n in range(start, finish+1):
        for i in str(n):
            xs[int(i)] += 1
    return xs

def paint_letterboxes(start, finish):
    painted = "".join(map(str, range(start, finish+1)))
    return [painted.count(digit) for digit in "0123456789"]

